import React from 'react';
import s from "./../Dialogs.module.css";

const Message = (props) => {

    let m = 'message';

    if(props.author){
        m += 'me';
    }else{
        m += 'other';
    }

    return (
        <div className={`s.${m}`}>{props.message}</div>
    );
}

export default Message;
